import "./Header.css"
import Search from "../Search/Search";
import React from "react"

const Header = () => {
    return(
        <div className="container">
            <div className="content--logo">
                <div className="header__logo--img"/>
                <p className="header__logo--text">
                    Corp
                </p>
                
            </div>
            <Search/>
        </div>
        
    )
}
export default Header;
